def creat_report(models=None,nb_model=10):
    """
    Create a report with the top models
    """
    repository = RepositoryModel()
    all_models = repository.get_top_models_by_metric("seed", 1, nb_model)

    metadatas = list(map(lambda x: x.info.metadata, all_models))
    #metadatas = [metadata] * 4
    models = list(map(lambda x: str(x.tag), all_models))

    html_content = ""
    with open("report_tmp.html", "r") as file:
        html_content = file.read()

    modified_html_content = html_content.replace("{{ models }}", json.dumps(models))
    modified_html_content = modified_html_content.replace("{{ metadatas }}", json.dumps(metadatas))

    with open("evaluation/report.html", "w") as file:
        file.write(modified_html_content)

def main() -> None:
    creat_report()

